let _callServices=()=>{fetch("../json/services.json").then(e=>e.json()).then(e=>{let t=document.getElementsByClassName("services"),l=e.services;l.map((e,l)=>{let n=document.createElement("div"),i=document.createElement("img"),s=document.createElement("h3");s.innerHTML=e.title,n.appendChild(i).src=e.img,n.appendChild(s).classList.add("align_center"),t[0].appendChild(n).classList.add("itemServices")})})},_callClients=()=>{fetch("../json/clients.json").then(e=>e.json()).then(e=>{let t=document.getElementsByClassName("clientes"),l=e.clientes;l.map((e,l)=>{let n=document.createElement("img");n.width=e.width,n.title=e.title,n.classList.add("cli-"+e.tipo),t[0].appendChild(n).src=e.img})})},_callGallery=()=>{fetch("../json/gallery.json").then(e=>e.json()).then(e=>{let t=document.getElementsByClassName("gallery"),l=e.gallery;l.map((e,l)=>{let n=document.createElement("div");n.classList.add("itemGallery");let i=document.createElement("img");i.title=e.title,i.src=e.img,n.appendChild(i),t[0].appendChild(n)})})},sticky=0,_fixedHeader=()=>{let e=document.getElementById("header");sticky=parseInt(e.offsetTop)+300,window.pageYOffset>sticky?e.classList.add("fixedHeader"):e.classList.remove("fixedHeader")},_parallaxSlider=()=>{let e=document.getElementById("sliderPrincipal"),t=window.pageYOffset;e.style.backgroundPosition="center "+-.15*t+"px"};_callGallery(),_callServices(),_callClients();let _clickAnchorLink=()=>{document.querySelectorAll('.anchor[href^="#"]').forEach(e=>{e.addEventListener("click",function(e){e.preventDefault();let t=document.getElementById("header").offsetHeight,l=document.querySelector(this.getAttribute("href")),n=parseInt(l.offsetTop)-(parseInt(t)+20);window.scrollTo({left:0,top:n,behavior:"smooth"})})})};window.onload=(()=>{_clickAnchorLink(),window.onscroll=(()=>{_parallaxSlider(),_fixedHeader()})});